import React from 'react';
import ReactDOM from 'react-dom';
import {hey} from '../public/my'

ReactDOM.render(
  <>
    <ul>
      <li>hello</li>
      <li>react</li>
    </ul>
    <button onClick={hey()}>Hey There!</button>
  </>,
  document.getElementById('root')
);
